Director: Spyder Jonez

In the Reign of Tera, Tera Patrick as herself, plays top girl at an all Asian high end brothel for select clientele. All applicants must apply thru her website. In the story Tera is torn between working as a Madame and falling in love with the owner of the Asian Love Palace, Mr Jonez. Tera is a Mrs. Roarke of granting sexual fantasies in her ultra exclusive brothel. Her beauty and sexuality are only rivaled by her wisdom, lust and desires.

